import "./style.css";
import sliderData from "./indexData";
import filmBorder from "../../assets/images/filmborder.png";
import { useState } from "react";

const Slider = () => {
  const [imageArray, setImageArray] = useState(sliderData);
  return (
    <section className="slider">
      {imageArray.map((image, index) => {
        return <img src={image} key={index} alt={image} />;
      })}
    </section>
  );
};
export default Slider;
